import React from "react";
import "./styleRating.css";

export default function RatingsDetailsCourse() {
  return (
    <div className="rating">
      <label id="rating-5" />
      <label id="rating-4" />
      <label id="rating-3" />
      <label id="rating-2" />
      <label id="rating-1" />
    </div>
  );
}
